import "./ExperienceSection.css";
import React from "react";

const ExperienceSection = ({}) => {
  return (
    <>
      <h1>Experience</h1>
      <div className="experience">
        <h5 className="date">2021</h5>
        <h4>Solidatus</h4>
      </div>
    </>
  );
};

export default ExperienceSection;
